import React, { Component } from 'react';
import Instrument from './Instrument';

class Sequencer extends Component {

  state = {
    instruments: [true],
    sequenceNumber: 0
  }

  componentDidMount() {
    console.log('Mounted!');
  }

  render() {
    return (
      <div>
        {this.state.instruments.map((val, idx) => {
          return (
            <Instrument />
          )
        })}
      </div>
    );
  }
}

export default Sequencer;
